function isVolleyball(mapName: string) {
    return ["v", "volley", "volleyball", "volleyball_training"].includes(mapName);
}

function isTennis(mapName: string) {
    return ["tennis", "tenis"].includes(mapName);
}

function getBallIndex(mapName: string) {
    if (isVolleyball(mapName)) {
        if (mapName === 'volleyball_training') return 3;
        return 17;
    }
    return 0;
}

let default_bg_color: Map<string, number> = new Map();
let default_ball_color: Map<string, number> = new Map();
for (let [mapName, map] of json_all_maps) {
    const ballIdx = getBallIndex(mapName);
    default_bg_color.set(mapName, Number.parseInt(map["bg"]["color"], 16));
    default_ball_color.set(mapName, Number.parseInt(map["discs"][ballIdx]["color"], 16));
}

export function isValidMap(mapName: string) {
    return json_all_maps.has(mapName);
}

export function getMap(mapName: string, bgColor: number = 0, ballColor: number = 0) {
    let map = json_all_maps.get(mapName);
    if (!map) return null;
    if (isVolleyball(mapName) || isTennis(mapName)) return map; // currently do not change colors
    if (!bgColor) bgColor = default_bg_color.get(mapName)!;
    if (!ballColor) ballColor = default_ball_color.get(mapName)!;

    const ballIdx = getBallIndex(mapName);
    map["bg"]["color"] = bgColor.toString(16);
    map["discs"][ballIdx]["color"] = ballColor.toString(16);
    return map;
}

export function updateMapPhysics(mapName: string, map: any, whichPhysics: MapPhysicsType) {
    const ballIdx = getBallIndex(mapName);
    let p = physics.get(whichPhysics)!;
    let ball = map["discs"][ballIdx];
    ball["radius"] = p.ball_radius;
    ball["bCoef"] = p.ball_bCoef;
    ball["invMass"] = p.ball_invMass;
    let player = map["playerPhysics"];
    player["bCoef"] = p.player_bCoef;
    player["invMass"] = p.player_invMass;
    player["damping"] = p.player_damping;
    player["acceleration"] = p.player_acceleration;
    player["kickingAcceleration"] = p.player_kickingAcceleration;
    player["kickingDamping"] = p.player_kickingDamping;
    player["kickStrength"] = p.player_kickStrength;
}
